import React from 'react';
import Document, { Html, Head, Main, NextScript } from 'next/document';
import { getAsset } from '../utils';
import config from '../config';

class MyDocument extends Document {
  static async getInitialProps(ctx) {
    const initialProps = await Document.getInitialProps(ctx);
    return { ...initialProps };
  }

  render() {
    return (
      <Html>
        <Head />
        <body>
          <Main />

          <NextScript />

          <div id="fb-root"></div>
          <div id="fb-customer-chat" className="fb-customerchat"></div>

          <script src={getAsset('js/jquery-3.2.1.min.js')}></script>
          <script src={getAsset('js/propper.js')}></script>
          <script src={getAsset('js/bootstrap.min.js')}></script>
          <script src={getAsset('vendors/bootstrap-selector/js/bootstrap-select.min.js')}></script>
          <script src={getAsset('vendors/wow/wow.min.js')}></script>
          <script src={getAsset('vendors/sckroller/jquery.parallax-scroll.js')}></script>
          <script src={getAsset('vendors/owl-carousel/owl.carousel.min.js')}></script>
          <script src={getAsset('vendors/nice-select/jquery.nice-select.min.js')}></script>
          <script src={getAsset('vendors/imagesloaded/imagesloaded.pkgd.min.js')}></script>
          <script src={getAsset('vendors/isotope/isotope-min.js')}></script>
          <script src={getAsset('vendors/magnify-pop/jquery.magnific-popup.min.js')}></script>
          <script src={getAsset('vendors/circle-progress/circle-progress.js')}></script>
          <script src={getAsset('vendors/counterup/jquery.counterup.min.js')}></script>
          <script src={getAsset('vendors/counterup/jquery.waypoints.min.js')}></script>
          <script src={getAsset('vendors/counterup/appear.js')}></script>
          <script src={getAsset('vendors/scroll/jquery.mCustomScrollbar.concat.min.js')}></script>
          <script src={getAsset('vendors/multiscroll/jquery.easings.min.js')}></script>
          <script src={getAsset('vendors/multiscroll/jquery.multiscroll.extensions.min.js')}></script>
          <script src={getAsset('js/main.js')}></script>
          {config.isProd && <script src={getAsset('js/fb-messenger.js')}></script>}
        </body>
      </Html>
    );
  }
}

export default MyDocument;
